import React, {Fragment} from "react";
import {
    ModalHeader,
    ModalBody,
    ModalFooter,
    Button,
    Form,
    FormGroup,
    Label,
    Input
} from "reactstrap";

const CreateProject = (props) =>{
    console.log(props);
        return (
            <Fragment>
                <ModalHeader toggle={props.handleCreateClick}>Create New Project</ModalHeader>
                <ModalBody>
                    <Form>
                        <FormGroup>
                            <Label for="examplePassword">Name</Label>
                            <Input type="text" name="description" />
                        </FormGroup>
                        <FormGroup className="form-switch">
                            <Input type="checkbox" name="flag" />
                            <Label for="examplePassword"><i className="bi bi-flag-fill text-danger p-2"></i>Flag the project </Label>
                        </FormGroup>
                    </Form>
                </ModalBody>
                <ModalFooter>
                    <Button color="primary" onClick={props.handleCreateClick} form="">Submit</Button>{' '}
                    <Button color="secondary" onClick={props.handleCreateClick}>Cancel</Button>
                </ModalFooter>
            </Fragment>
        )

}

export default CreateProject;
